"use strict";
{
    // Object Types
    let person = {
        name: "Alice",
        age: 30,
        isActive: true,
    };
    console.log(person);
    let Details = {
        name: "Alice",
        age: 30,
        address: {
            street: "123 Main St",
            city: "Metropolis",
            zipCode: 1234,
        },
    };
    console.log(Details);
    //Object types can also contain other objects as properties.
}
